import { useState } from "react";
import { Link } from "react-router-dom";

const tab = ({isclick}) => {
    return (
        isclick && <>
        <div>About</div>
        <div>Support</div></>
    )
}

const Ham = () => {
    const userid = localStorage.getItem("userid");
    const [isopen, setopen] = useState(false);
    return (
        <div>
            <img onClick={() => {setopen(!isopen)}}src="https://www.clipartmax.com/png/small/351-3518256_menu-hamburger-icon-svg-white.png" />
            {userid && <div style={{overflowWrap : "break-word"}}><Link to="/profile">userid</Link></div>}
            <tab isclick={isopen} />
        </div>
    );
}

export default Ham;
